import React from "react";
class MyLinegraph extends React.Component {
render() {
    return (
      <MDBContainer>
        <h3 className="mt-5">Annual Chart</h3>
        <Bar data={this.state.dataBar} options={this.state.barChartOptions} />
      </MDBContainer>
    );
  }
}

export default MyLinegraph;
